const $skipNavi=$("#skipNavi"),$skipNavi_btn=$skipNavi.find("a");$skipNavi_btn.on("click",(function(i){let t=$(this).attr("href"),n=$(t).offset().top;i.preventDefault(),console.log(t),$("html, body").animate({scrollTop:n},1e3)})),$skipNavi_btn.on("focusin",(function(){$(this).css({top:0})})),$skipNavi_btn.on("focusout",(function(){$skipNavi_btn.css({top:-30})}));